import React from "react";
import { Link } from "react-router-dom";
import "./card.css";

const Card = ({ posterPath, item }) => {
  return (
    <Link to={"/detail/" + item.id}>
      <div className="card-movie">
        <img src={posterPath} alt={item.title}></img>
        <p>{item.title}</p>
        <p>{item.vote_average}</p>
      </div>
    </Link>
  );
};

export default Card;
